import React, { Component } from 'react'
import Head from './Head'
import Login from './Login'
import { CookiesProvider, withCookies } from 'react-cookie'
class Monitor extends Component {
    constructor() {
        super()
        this.state = {
            loginStat: false,
            page: "0",
            ren: <html></html>
        }
    }

    componentDidMount() {
        let pagesLogin = this.state.loginStat
        if (pagesLogin === false) {
            this.setState({
                ren: <div><Login /></div>
            })
        }
    }

    propsMomitor = (e) => {
        console.log(e)
        this.setState({
            page: e.toString()
        })
    }

    componentWillReceiveProps(e) {

    }
    render() {
        return (
            <div>
                <CookiesProvider>
                    <Head toMonitor={this.propsMomitor} />
                    {this.state.page}
                    {this.state.ren}
                </CookiesProvider>
            </div>
        )
    }
}

export default withCookies(Monitor)
